  "longAnswer": "1. \u0026nbsp;I loved having time with Arlene in person to plan on stuff (or the beginning of it anyway) for next year. \u0026nbsp;It helps to be able to see each other and not feel the time pressure of being on a google hangout where other things might be distracting us. \u0026nbsp;\u003cbr /\u003e\r\n\u0026nbsp;\u0026nbsp; \u0026nbsp;When doing the afternoon google hangout this afternoon, we still seemed to get hung up in a few glitches in the software and didn\u0026#39;t spend as much time really focusing on the student work as I would have liked. \u0026nbsp;I liked the model though.\u0026nbsp;\u003cbr /\u003e\r\n\u003cbr /\u003e\r\n2. \u0026nbsp;I\u0026#39;m concerned that the other teacher I\u0026#39;m teaching Algebra 2 H with won\u0026#39;t want to do the POW\u0026#39;s. \u0026nbsp;I\u0026#39;m wondering if I just move forward and if he doesn\u0026#39;t , he doesn\u0026#39;t and he just has to plan something else or if there might be a way I can ease him in. \u0026nbsp;\u003cbr /\u003e\r\n\u003cbr /\u003e\r\n3. \u0026nbsp;Nothing really...",
