  "longAnswer": "1) I really appreciated thinking about student work and looking at ways to do quick sorts using the Encompass software. \u0026nbsp;Using it is a professional development is useful. \u0026nbsp;The least useful activity for me was probably selecting the problem for the beginning of the year, as I had planned to do that activity, though this just saved me some time later.\u003cbr /\u003e\r\n\u003cbr /\u003e\r\n2) \u0026nbsp;I\u0026#39;m wondering how I can get more of my colleagues using the Math Forum in planning problem solving work for students. \u0026nbsp;I\u0026#39;ll need to do something during preservice.\u003cbr /\u003e\r\n\u003cbr /\u003e\r\n3) \u0026nbsp;None at this point. \u0026nbsp;I\u0026#39;ll reflect more throughout the evening.\u003cbr /\u003e\r\n\u003cbr /\u003e\r\n\u0026nbsp;",
