  "longAnswer": "I hated the opening exercise, but that doesn\u0026#39;t mean that I didn\u0026#39;t value it. I hate being alone with my thoughts because of the direction that they often send me, but I know I need to do it more often. \u0026nbsp;It was interesting to hear what other participants had to say, but very frustrating and liberating to not be able to respond.\u003cbr /\u003e\r\n\u003cbr /\u003e\r\nI am very much enjoying the online participants, who are bringing fresh perspectives to the discussion.\u0026nbsp;\u003cbr /\u003e\r\n\u003cbr /\u003e\r\nI made several suggestions for improvements to the software and all were met with \u0026quot;Yup! That\u0026#39;s in the pipeline.\u0026quot;\u003cbr /\u003e\r\nYou guys and gals are on the ball!",
