  "longAnswer": "1) Most useful: hangout with Sebastian because I was quite un-successful yesterday, so it was great to have no technical glitches today, and Sebastian gave useful feedback regarding software that I didn\u0026#39;t think about.\u003cbr /\u003e\r\n\u003cbr /\u003e\r\nNot useful: can\u0026#39;t think of anything\u003cbr /\u003e\r\n\u003cbr /\u003e\r\n2) I\u0026#39;m wondering what the timeline is for software to do some of the stuff that we\u0026#39;d suggested.\u003cbr /\u003e\r\n\u003cbr /\u003e\r\n3) I can\u0026#39;t think of anything for improvement because I really appreciate the pacing and the activities that we have thus far.",
