  "longAnswer": "\u003cbr /\u003e\r\n\u003cbr /\u003e\r\n\u0026nbsp;\u0026nbsp;\u0026nbsp; What was most useful for you today? What was least useful?\u003cbr /\u003e\r\nMost useful was working on the problem and discussing anticipated student responses.\u0026nbsp; Then seeing those responses in the examples of work we looked at on the software.\u0026nbsp; Least useful was the first snack between breakfast and lunch. \u0026nbsp;\u003cbr /\u003e\r\n\u003cbr /\u003e\r\n\u0026nbsp;\u0026nbsp;\u0026nbsp; What are you wondering about?\u003cbr /\u003e\r\nI still have questions about the software and how it will work when I assign problems to my own students.\u0026nbsp; I am curious about what the student view looks like.\u0026nbsp; I am wondering how having all this new \u0026quot;data\u0026quot; will help me in my instruction.\u003cbr /\u003e\r\n\u003cbr /\u003e\r\n\u0026nbsp;\u0026nbsp;\u0026nbsp; What suggestions do you have for improvement?\u003cbr /\u003e\r\nI would like to have my students\u0026#39; work imported into the new software.\u0026nbsp; Do the mentor\u0026#39;s comments/replies appear anywhere in the new software?",
