  "longAnswer": "Most helpful:\u003cbr /\u003e\r\nOpportunity to think about the scenario with both the entire institute and in table groups was thought provoking. In particular, I found the exercise of creating a representation to be very illuminating as a mechanism for gaining insight into someone else\u0026#39;s thinking.\u003cbr /\u003e\r\nOn an extremely personal level, I am immensely grateful for the chance to think with Steve about the triangle problem. That problem came to me from the Math Forum when I needed more mathematics in my life and has been a cherished place to muck about over the past 2 years. Getting to talk about it this morning was special in a way I am struggling to put into words. Thank you.\u003cbr /\u003e\r\nLeast helpful:\u003cbr /\u003e\r\nNot sure....\u003cbr /\u003e\r\nWondering:\u003cbr /\u003e\r\nOnce again I am struck by how much I continue to gain by being here but am uncertain of how my presence/participation is of value to the Math Forum \u0026amp;/or the EnCompass project.\u003cbr /\u003e\r\nSuggestions:\u003cbr /\u003e\r\nWhile I revel in the chance to have largely philosophical discussions, I recognize that some of our table talk during the last exercise of the day kept us from addressing the task at hand. It might be useful to have a protocol for regulating the use of time to be more attentive to the work that needs to happen for the project. Not sure if a parking lot or a talk timer or a strolling taskmaster would/could be an appropriate remedy, but I am concerned that what we did was largely esoteric and did little, in anything, to contribute to the substantial undertaking at hand.",
