  "shortAnswer": "-The most useful part of today was having Max facilitate our morning PoW: A Pound of Valentine's Chocolates. I enjoyed Max having us think of a representation for the scenario he presented. I enjoyed listening to and seeing al the different approaches to solving.\r\n-The least useful part of today was Connections. I would appreciate us having a chance to follow up with group discussions after connections to ask anyone questions about something they shared during connections. \r\n-I'm wondering about if we will be able to see the uploaded image-of-student-work feature of the Encompass software.\r\n-Once groups have been assigned to their tables, put the prompts (charges) back on the screen so we can refer to them during our group discussion time.",
