  "longAnswer": "Okay, \u0026nbsp;I enjoyed everything today.\u003cbr /\u003e\r\n\u003cbr /\u003e\r\nI liked Mary\u0026#39;s comment about everyone being superstars and it is how I feel. \u0026nbsp;I means to me that everyone is highly valued by the community. \u0026nbsp;How great is that.\u003cbr /\u003e\r\n\u003cbr /\u003e\r\n\u003cspan style=\"color:#00FFFF;\"\u003eJustin doesn\u0026#39;t like the color teal.\u003c/span\u003e\u003cbr /\u003e\r\n\u003cbr /\u003e\r\nI am still enjoying playing with the software and look forward to more. \u0026nbsp;I like the idea of preset curated folders that can be set to \u0026quot;include everytime\u0026quot; or \u0026quot;choose\u0026quot;.\u003cbr /\u003e\r\n\u003cbr /\u003e\r\nI wonder what the learning curve will be like for new teachers to our new software? \u0026nbsp;Are there multiple entry points?\u0026nbsp;\u003cbr /\u003e\r\n\u0026nbsp;",
